description:
The Football League Show 11.01.2014

Duration: 1 hour 18 min

Manish Bhasin presents action from the Football League as Harry Redknapp's QPR side, favourites for a quick return to the Premier League, visit Portman Road to face another club with promotion ambitions: Ipswich. Plus extended highlights from a fiercely contested Yorkshire derby as Sheffield Wednesday go head-to-head with Leeds United.
